import React from "react";
import './home.css';

const Home = () => {
    return (
        <>
            <section className="home home-page">
                <div className="home-container">
                    <div className="row">
                        <h1>Home Decor</h1>
                        <h1>Made Easy</h1>
                    </div>
                </div>
            </section>
        </>
    );
}

export default Home;
